import React from "react";

function Tracks({title, status, id}) {
  return (
    <li className="status" key={id}>
      <h2> {title} </h2>
      <br />
      <button onClick={console.log(event.target.value)}>X</button>
      Status: {status}
    </li>
  );
}
export default Tracks;
